import React from "react";
import InputLabel from "@material-ui/core/InputLabel";
import MenuItem from "@material-ui/core/MenuItem";
import FormHelperText from "@material-ui/core/FormHelperText";
import FormControl from "@material-ui/core/FormControl";
import Select from "@material-ui/core/Select";
import TextField from "@material-ui/core/TextField";
import Button from "@material-ui/core/Button";
import styled from "styled-components";
import "./1form.css";
import Campaign from "./2Campaign";

function Form(props) {
  const { setStep, userData, setUserData } = props;

  const [age, setAge] = React.useState("");

  const handleChange = (event) => {
    setAge(event.target.value);
  };

  return (
    <div>
      <div className="container mt-5 row col-12 ">
        <form>
          <div className="row col-12 ">
            <div className="col-6">
              <h2> Let's get started with your business details</h2>
              <h3>
                {" "}
                To be or not to be that's the question, whether it's the nobler
                to suffer
              </h3>
            </div>

            <div className="col-6 text-center">
              <h4>Fill-in the form below</h4>
              <div style={{ justifyContent: 500 }}>
                <div>
                  <TextField
                    type="text"
                    value={userData["name"]}
                    onChange={(e) =>
                      setUserData({ ...userData, name: e.target.value })
                    }
                    placeholder="BUSINESS NAME"
                    margin="dense"
                    variant="outlined"
                    size="small"
                    fullWidth={true}
                  />
                </div>
              </div>

              <div>
                <TextField
                  type="text"
                  value={userData["website"]}
                  onChange={(e) =>
                    setUserData({ ...userData, website: e.target.value })
                  }
                  placeholder="WEBSITE"
                  margin="dense"
                  variant="outlined"
                  size="small"
                  fullWidth={true}
                />
              </div>
              <div>
                <TextField
                  type="text"
                  value={userData["loc"]}
                  onChange={(e) =>
                    setUserData({ ...userData, loc: e.target.value })
                  }
                  placeholder="LOCATION "
                  margin="dense"
                  variant="outlined"
                  size="small"
                  fullWidth={true}
                />
              </div>
              <div>
                <TextField
                  type="text"
                  value={userData["phone"]}
                  onChange={(e) =>
                    setUserData({ ...userData, phone: e.target.value })
                  }
                  placeholder="PHONE NUMBER"
                  margin="dense"
                  variant="outlined"
                  size="small"
                  fullWidth={true}
                />
              </div>
              <div>
                <FormControl style={{minWidth: 620}}>
                  <InputLabel id="demo-simple-select-label">
                    BUSINESS CATEGORY
                  </InputLabel>
                  <Select
                    labelId="demo-simple-select-label"
                    id="demo-simple-select"
                    margin="dense"
                    value={age}
                    onChange={handleChange}
                    size="small"
                    variant="outlined"
                    fullWidth={true}
                  >
                    <MenuItem value={10}>IT Sector</MenuItem>
                    <MenuItem value={20}>Manufacturing</MenuItem>
                    <MenuItem value={30}>Telecom</MenuItem>
                  </Select>
                </FormControl>
                <Button style={{marginTop: "100px"}}size="large" onClick={() => setStep(2)}>
                Next{" "}
              </Button>
              </div>
            </div>

          </div>
        </form>
      </div>
    </div>
  );
}

export default Form;
